import { Card, CardContent, List, ListItem, Toolbar, Typography } from "@mui/material";
import { pink } from "@mui/material/colors";

const Preparation = () => {
    return (
        <>
            <Toolbar>
                <Card>
                    <CardContent>
                        <Typography variant="h5" gutterBottom>
                            Preparation Time
                        </Typography>
                        <List
                            sx={{
                                backgroundColor: pink[100], // Light pink background
                                borderRadius: 2, // Optional: Adds rounded corners
                                padding: 2, // Optional: Adds padding
                            }}
                        >
                            <ListItem>Total: Approximately 10 minutes</ListItem>
                            <ListItem>Preparation: 5 minutes</ListItem>
                            <ListItem>Cooking: 5 minutes</ListItem>
                        </List>
                    </CardContent>
                </Card>
            </Toolbar>
        </>
    );
};

export default Preparation;
